import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { logoutUser } from '../../actions/authAction';
import { clearCurrentProfile } from '../../actions/profileAction';
import "../navbar/Navbar.css"
import WhiteLogo from "../../assets/logo-white.png"


class Navbar extends Component {
  onLogoutClick(e) {
    e.preventDefault();
    this.props.clearCurrentProfile();
    this.props.logoutUser();
  }
	render() {
    const { isAuthenticated, user } = this.props.auth;
    const gestLink = (
      <li><Link to="/login" data-toggle="collapse" data-target=".navbar-collapse.in">Login/Register</Link></li>
      )
    const authLink = (
      <li>
        <Link to="/" className="dropdown-toggle" data-toggle="dropdown" role="button" aria-haspopup="true" aria-expanded="false">
          <img 
            src={ user.name, require('../../assets/img/user.png')} 
            alt='logOut'             
          /><span className="caret"></span></Link>
        <ul className="dropdown-menu">                       
            <li><Link to="/login">{user.name}</Link></li>
            <li><Link to={`/user-order-list/${user.id}`}>Order List</Link></li>
            <li>
              <a href="/" onClick={this.onLogoutClick.bind(this)} className="nav-link">
                <Link to='/' data-toggle="collapse" data-target=".navbar-collapse.in"><li>Logout</li></Link>
              </a>
            </li>            
        </ul>
    </li>
    )
    const authUserLinks = (
      <div className="navbar-wrapper header dark">
         <div className="container no-padding">
           <nav className="navbar main-nav navbar-inverse navbar-static-top">
             <div className="container">
               <div className="navbar-header">
                 <button type="button" className="navbar-toggle collapsed" data-toggle="collapse" data-target="#navbar" aria-expanded="false" aria-controls="navbar">
                   <span className="sr-only">Toggle navigation</span>
                   <span className="icon-bar"></span>
                   <span className="icon-bar"></span>
                   <span className="icon-bar"></span>
                 </button>
                 <Link className="navbar-brand" to="/">
                    <img className="logo img-responsive" src={WhiteLogo} alt="Stealth Sonics Logo"/>
                 </Link>
               </div>
               <div id="navbar" className="navbar-collapse collapse">
                 <ul className="nav navbar-nav">
                   <li><Link to="/" data-toggle="collapse" data-target=".navbar-collapse.in">Home</Link></li>
                   <li className="dropdown">
                     <Link to="/"  className="dropdown-toggle"  data-toggle="dropdown" role="button" aria-haspopup="true" aria-expanded="false">About <span className="caret"></span></Link>
                     <ul className="dropdown-menu">
                       <li><Link to="/about" data-toggle="collapse" data-target=".navbar-collapse.in">Team Stealth Sonics</Link></li>

                         {/* <li><Link to="/news" data-toggle="collapse" data-target=".navbar-collapse.in">News</Link></li>
                         <li><Link to="/mediakit" data-toggle="collapse" data-target=".navbar-collapse.in">Media Kit</Link></li> */}
                         <li><Link to="/partner" data-toggle="collapse" data-target=".navbar-collapse.in">Partner</Link></li>

                     </ul>
                   </li>
                   <li><Link to="/" className="dropdown-toggle" data-toggle="dropdown" role="button" aria-haspopup="true" aria-expanded="false">Products <span className="caret"></span></Link>
                     <ul className="dropdown-menu">
                       <li><Link to="/u2series" data-toggle="collapse" data-target=".navbar-collapse.in">U2 Series</Link></li>
                       <li><Link to="/u4series" data-toggle="collapse" data-target=".navbar-collapse.in">U4 Series</Link></li>
                       <li><Link to="/u9series"data-toggle="collapse" data-target=".navbar-collapse.in">U9 Series</Link></li>
                       <li><Link to="/c2series"data-toggle="collapse" data-target=".navbar-collapse.in">C2 Series</Link></li>
                       <li><Link to="/c4series"data-toggle="collapse" data-target=".navbar-collapse.in">C4 Series</Link></li>
                       <li><Link to="/c9series"data-toggle="collapse" data-target=".navbar-collapse.in">C9 Series</Link></li>
                       <li><Link to="/hearingprotection"data-toggle="collapse" data-target=".navbar-collapse.in">Hearing Protection</Link></li>
                       <li><Link to="/accessories"data-toggle="collapse" data-target=".navbar-collapse.in">Accessories</Link></li>
                     </ul>
                   </li>
                   <li><Link to="/customorder" data-toggle="collapse" data-target=".navbar-collapse.in">Custom Order</Link></li>
                   <li><Link to="/thescience" data-toggle="collapse" data-target=".navbar-collapse.in">The Science</Link></li>
                   <li><Link to="/artist" data-toggle="collapse" data-target=".navbar-collapse.in">Artist</Link></li>
                    <li className="dropdown">
                     <Link to="/" className="dropdown-toggle"  data-toggle="dropdown" role="button" aria-haspopup="true" aria-expanded="false">Media <span className="caret"></span></Link>
                     <ul className="dropdown-menu">

                        <li><Link to="/mediakit" data-toggle="collapse" data-target=".navbar-collapse.in">Media Kit</Link></li>
                        <li><Link to="/news" data-toggle="collapse" data-target=".navbar-collapse.in">News</Link></li>
                        <li><Link to="/reviews" data-toggle="collapse" data-target=".navbar-collapse.in">Reviews</Link></li>

                     </ul>
                    </li>
                   <li><Link to="/contact" data-toggle="collapse" data-target=".navbar-collapse.in">Contact Us</Link></li>
                   {isAuthenticated ? authLink : gestLink}
                    <li className="dropdown">
                      <Link to="/" className="dropdown-toggle"  data-toggle="dropdown" role="button" aria-haspopup="true" aria-expanded="false"><span className="glyphicon glyphicon-globe globe-icon"></span> Region <span className="caret"></span></Link>
                      <ul className="dropdown-menu">
                          <li><a href="/jp/home" data-toggle="collapse" data-target=".navbar-collapse.in">Japanese</a></li>
                          <li><a href="/" data-toggle="collapse" data-target=".navbar-collapse.in">English</a></li>
                      </ul>
                    </li> 
                 </ul>
               </div>
             </div>
           </nav>
         </div>
       </div>

    );
		return(
      <div>
          {authUserLinks}
      </div>
		)
	}
}
Navbar.propsType = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired
}
const mapStateToProps = (state) => ({
  auth: state.auth,
})

export default connect(mapStateToProps, { logoutUser, clearCurrentProfile })(Navbar);
